function ThemdButton() {
  return <button>I am styled by theme context</button>;
}

function Toolbar(props) {
  return (
    <div>
      <ThemdButton />
    </div>
  );
}

function App() {
  return (
    <>
      <Toolbar />
    </>
  );
}

export default App;
